import React from "react";

const QuoteBlock = () => {
    return (
        <div className="quoteblock">
            <h2>TECHNOLOGY THAT WINS ON EVERY TRACK</h2>
            <p>Oparte na wieloletnim doświadczeniu i najnowszej technologii, gokarty Praga są odpowiednim narzędziem do osiągnięcia sukcesu w każdym wyścigu, na każdym torze.</p>
        </div>
    )
}

export default QuoteBlock;
